css:
.auto-cursor {
  cursor: default;
}
kite-expand {
  display: flex;
  flex-direction: column;
  color: #9da5b4;
  padding: 5px;
  font-family: system-ui;
  max-height: 50vh;
  overflow-y: auto;
  position: relative;
}
kite-expand .debug {
  margin-top: 5px;
}
kite-expand .debug pre {
  cursor: text;
  -webkit-user-select: all;
  user-select: all;
  max-height: 300px;
  max-width: 500px;
  overflow: auto;
}
kite-expand .debug pre > * {
  pointer-events: none;
}
kite-expand kite-navigable-stack-breadcrumb {
  flex: 0 0 auto;
  align-items: center;
  bottom: 5px;
  position: absolute;
  z-index: 2;
}
kite-expand kite-navigable-stack-breadcrumb ul.breadcrumb {
  display: none;
}
kite-expand kite-navigable-stack {
  flex: 1 1 auto;
  overflow: hidden;
}
kite-expand kite-navigable-stack > * {
  height: auto;
}
kite-expand kite-navigable-stack > * .sections-wrapper {
  flex: 1 1 auto;
  overflow-y: auto;
}
kite-expand kite-navigable-stack > * footer {
  display: block;
  margin-top: 10px;
}
kite-expand kite-navigable-stack kite-members-list,
kite-expand kite-navigable-stack kite-examples-list,
kite-expand kite-navigable-stack kite-links-list {
  padding-bottom: 2.5em;
}
atom-overlay > kite-expand,
body > kite-expand {
  background: #282c34;
  border: 1px solid #51555c;
  border-radius: 3px;
  max-width: 40em;
  min-width: 20em;
  box-shadow: 0 0.5em 1em rgba(0, 0, 0, 0.1);
}
kite-expand[data-screen-row] {
  width: 100%;
  background: #282c34;
  border: 1px solid #51555c;
}
